'use strict';

/**
* Beta prime distributed pseudorandom numbers.
*
* @module @stdlib/math/base/random/betaprime
*
* @example
* var betaprime = require( '@stdlib/math/base/random/betaprime' );
*
* var v = betaprime( 2.0, 3.0 );
* // returns <number>
*
* @example
* var factory = require( '@stdlib/math/base/random/betaprime' ).factory;
*
* var betaprime = factory( 3.0, 2.0, {
*     'seed': 297
* });
*
* var v = betaprime();
* // returns ~0.411
*/

// MODULES //

var setReadOnly = require( '@stdlib/utils/define-read-only-property' );
var betaprime = require( './betaprime.js' );
var factory = require( './factory.js' );


// MAIN //

setReadOnly( betaprime, 'factory', factory );


// EXPORTS //

module.exports = betaprime;
